import React from 'react';
import ReactDOM from 'react-dom';
import Profile from './Task01/Task01';
import Stats from './Task02/Task02';


const user = {
    name: 'Jacques Gluke',
    tag: '@jgluke',
    location: 'Ocho Rios, Jamaica',
    avatar: 'https://s3.amazonaws.com/uifaces/faces/twitter/r_oy/128.jpg',
    stats: {
        followers: 5603,
        views: 4827,
        likes: 1308,
    },
};

ReactDOM.render(< Profile user={
    user
}
/>, document.getElementById('root'));




const stats = [{
    id: 'id-1',
    label: '.docx',
    percentage: 22
},
{
    id: 'id-2',
    label: '.pdf',
    percentage: 4
},
{
    id: 'id-3',
    label: '.mp3',
    percentage: 17
},
{
    id: 'id-4',
    label: '.psd',
    percentage: 47
},
{
    id: 'id-5',
    label: '.pdf',
    percentage: 10
},
];

ReactDOM.render(<
    Stats title="Upload stats"
    stats={
        stats
    }
/>,
    document.getElementById('root'),
);
